import { Button, HStack } from "@chakra-ui/react";
import Profile from "../components/Profile";

const Header = () => {
  return (
    <>
      <HStack>
        <Profile/>
        <Profile/>
      </HStack>
      <Button>Go!</Button>
    </>
  );
};

export default Header;
